import { Mahjong, EmptyMahjong } from './mahjongs/Mahjong';

export class Level {
  id: number;
  difficulty: number;
  board: Mahjong[][][];
  background: string;

  constructor(id: number, difficulty: number, board: Mahjong[][][], background: string) {
    this.id = id;
    this.difficulty = difficulty;
    this.background = background;

    // Initialize board with EmptyMahjong instances
    this.board = board.map(layer => layer.map(row => row.map(() => new EmptyMahjong())));
  }
}
